import './MainHeader';
import '../css/MainHeader.css';
import logo from '../../logo.svg';
const MainHeader = () => {
  return (
    <div className="header">
      <img className="siteIcon" src={logo}></img>
      <img
        src={logo}
        style={{
          height: 60,
          marginLeft: 20,
          backgroundColor: 'black',
          alignSelf: 'top',
        }}
      ></img>
    </div>
  );
};
export default MainHeader;
